// pages/BlogPage.js
import React from 'react';

const BlogPage = () => {
  return (
    <div>
      <h1>Blog</h1>
      <p>Welcome to our chess blog! Here you can find articles and news.</p>
      {/* 博客文章列表可以在这里展示 */}
    </div>
  );
};

export default BlogPage;
